import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import axios from 'axios';

function APIDetails() {
  const { apiName } = useParams(); // Get the API name from the URL
  const navigate = useNavigate();
  const [billingDetails, setBillingDetails] = useState(null);
  const [cpuUtilization, setCpuUtilization] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState('');

  // Fetch billing and CPU utilization data
  useEffect(() => {
    const fetchData = async () => {
      try {
        // Fetch billing details
        const billingResponse = await axios.get(`http://localhost:5000/billing-details/${apiName}`);
        setBillingDetails(billingResponse.data);

        // Fetch CPU utilization
        const cpuResponse = await axios.get(`http://localhost:5000/cpu-utilization/${apiName}`);
        setCpuUtilization(cpuResponse.data);

        setIsLoading(false);
      } catch (err) {
        setError('Failed to fetch data. Please try again.');
        setIsLoading(false);
        console.error('Error fetching data:', err);
      }
    };

    fetchData();
  }, [apiName]);

  // Handle back navigation
  const handleBack = () => {
    navigate(-1);
  };

  if (isLoading) {
    return <div className="text-center py-8">Loading...</div>;
  }

  if (error) {
    return <div className="text-center py-8 text-red-500">{error}</div>;
  }

  return (
    <div className="min-h-screen bg-gray-100 p-8">
      <div className="max-w-4xl mx-auto">
        <button
          onClick={handleBack}
          className="mb-6 px-4 py-2 bg-blue-500 text-white rounded hover:bg-blue-600"
        >
          Back
        </button>
        <h1 className="text-3xl font-bold mb-6">API Details: {apiName}</h1>

        {/* Billing Details */}
        <div className="bg-white rounded-lg shadow-md p-6 mb-6">
          <h2 className="text-xl font-semibold mb-4">Billing Details</h2>
          <table className="w-full">
            <thead>
              <tr>
                <th className="text-left py-2">Metric</th>
                <th className="text-left py-2">Value</th>
              </tr>
            </thead>
            <tbody>
              {billingDetails && Object.entries(billingDetails).map(([metric, value], index) => (
                <tr key={index} className="border-t">
                  <td className="py-2">{metric}</td>
                  <td className="py-2">{value}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>

        {/* CPU Utilization */}
        <div className="bg-white rounded-lg shadow-md p-6">
          <h2 className="text-xl font-semibold mb-4">CPU Utilization</h2>
          <table className="w-full">
            <thead>
              <tr>
                <th className="text-left py-2">Timestamp</th>
                <th className="text-left py-2">Usage (%)</th>
              </tr>
            </thead>
            <tbody>
              {cpuUtilization && cpuUtilization.map((entry, index) => (
                <tr key={index} className="border-t">
                  <td className="py-2">{entry.timestamp}</td>
                  <td className="py-2">{entry.usage}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

export default APIDetails;
